import "../src/scss/styles.scss";
import { motion } from "framer-motion";

export default function MyApp({ Component, pageProps, router }) {
  return (
    <motion.div
      key={router.route}
      exit="pageExit"
      initial="pageInitial"
      animate="pageAnimate"
      variants={{
        pageInitial: {
          opacity: 0,
        },
        pageAnimate: {
          opacity: 1,
        },
        pageExit: {
          opacity: 0,
        },
      }}
    >
      <Component {...pageProps} />
    </motion.div>
  );
}
